Click the “File” button in the left hand corner of the screen, then click on “Insert File.” {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/51\/Insert-a-File.png\/460px-Insert-a-File.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/51\/Insert-a-File.png\/760px-Insert-a-File.png","smallWidth":460,"smallHeight":307,"bigWidth":760,"bigHeight":507.3626373626374,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Find the file folder named “3D object, that should be located on the desktop. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/3\/35\/Finding-your-Folder.png\/459px-Finding-your-Folder.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/3\/35\/Finding-your-Folder.png\/759px-Finding-your-Folder.png","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Double click on the file folder and select the .STL file. Click the button on the bottom of the file explorer that says “open.” {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/50\/Open-the-Folder.png\/459px-Open-the-Folder.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/50\/Open-the-Folder.png\/759px-Open-the-Folder.png","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Click on the red button in the bottom right hand corner of the screen that says export. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/d\/dd\/Export-your-print.png\/459px-Export-your-print.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/d\/dd\/Export-your-print.png\/759px-Export-your-print.png","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Find the folder named “3D object,” double click on that. Name the file. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/d\/d4\/Rename.png\/459px-Rename.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/d\/d4\/Rename.png\/759px-Rename.png","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Click “Save.”
Check to see if the following message pops up on the screen. If so, the print has exported successfully. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/3\/30\/Success-message-from-Makerbot.png\/460px-Success-message-from-Makerbot.png","bigUrl":"https:\/\/www.wikihow.com\/images\/thumb\/3\/30\/Success-message-from-Makerbot.png\/760px-Success-message-from-Makerbot.png","smallWidth":460,"smallHeight":307,"bigWidth":760,"bigHeight":507.3626373626374,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Click on the ^ button on the bottom right hand side of the screen. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/f\/f3\/Right-Hand-Screen-Corner.png\/460px-Right-Hand-Screen-Corner.png","bigUrl":"https:\/\/www.wikihow.com\/images\/f\/f3\/Right-Hand-Screen-Corner.png","smallWidth":460,"smallHeight":278,"bigWidth":760,"bigHeight":459.73534971644614,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Go up to the picture that looks like a USB drive and right click on it. Click on the option that says “Eject DISK.” {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/56\/Eject-DISK.png\/460px-Eject-DISK.png","bigUrl":"https:\/\/www.wikihow.com\/images\/5\/56\/Eject-DISK.png","smallWidth":460,"smallHeight":347,"bigWidth":760,"bigHeight":573.304347826087,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

The device is safe to remove when the following message appears in the bottom right hand corner of the screen. {"smallUrl":"https:\/\/www.wikihow.com\/images\/thumb\/5\/55\/Safety-message-from-windows.png\/460px-Safety-message-from-windows.png","bigUrl":"https:\/\/www.wikihow.com\/images\/5\/55\/Safety-message-from-windows.png","smallWidth":460,"smallHeight":293,"bigWidth":760,"bigHeight":483.8800705467372,"licensing":"<div class=\"mw-parser-output\"><p>License: <a rel=\"nofollow\" class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Fair_use\">Fair Use<\/a> (screenshot)<br>\n<\/p><\/div>"}

Select "Print" by pushing the big silver button/knob on the printer. {"smallUrl":"https://www.wikihow.com/images/thumb/c/c4/Select-Print.png/460px-Select-Print.png","bigUrl":"https://www.wikihow.com/images/thumb/c/c4/Select-Print.png/759px-Select-Print.png","smallWidth":460,"smallHeight":220,"bigWidth":760,"bigHeight":363.2967032967033,"licensing":"<div class="mw-parser-output"><p>Image by: Uploader<br>
